import { Component } from "react";
import SobreMi from '../../img/SobreMi.png';
import FormacionAcademica from '../../img/FormacionAcademica.png';
import LenguajesYHerramientas from '../../img/LenguajesYHerramientas.png';
import Competencias from '../../img/Competencias.png';
import Experiencia from '../../img/Experiencia.png';
import OpenClose from '../../img/OpenNClose.png';
import './Nav.css';


export default class Nav extends Component{
    state={
        toggleMenu : false,
        screenWidth : window.innerHeight
    }

    render(){
        console.log(this.state.screenWidth)
        return(
            <header>
                <a className="aNav" href='/'>
                    <h1>Analie Flórez Sánchez</h1>
                    <h2>Desarrollo Full Stack</h2>
                </a>
                <nav className="navIcons">
                <ul className={"icons"}>
                        <li className='ListNav'><img src={SobreMi} alt="Sobre mí"/><h1>&lt;SobreMí/&gt;</h1> </li>
                        <li className='ListNav'><img src={FormacionAcademica} alt="Formación Académica"/><h1>&lt;Formación/&gt;</h1></li>
                        <li className='ListNav'><img src={LenguajesYHerramientas} alt="Lenguajes y Herramientas"/><h1>&lt;Lenguajes/&gt;</h1></li>
                        <li className='ListNav'><img src={Competencias} alt="Competencias"/><h1>&lt;Competencias/&gt;</h1></li>
                        <li className='ListNav'><img src={Experiencia} alt="Experiencia"/><h1>&lt;Experiencia/&gt;</h1></li>
                    </ul>
                </nav>
            </header>
        )
    }
}
